property.value:
let fkAssociation = element.getStereotype("Foreign Key")?.getProperty("Association")?.getSelected();

return !element.hasStereotype('Primary Key') 
    // if has FK, is aggregation
    && (fkAssociation == null || fkAssociation.getOtherEnd().typeReference.getIsCollection() || fkAssociation.getOtherEnd().typeReference.getIsNullable());
